import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Router>
      <header>
      </header>
        <main>
        <Routes>
          <Route />
          <Route />
          <Route />
        </Routes>
        </main>
        <footer></footer>
      </Router>
    </div>
  );
}

export default App;
